INSERT INTO `media` (`id`, `title`, `description`, `image`, `date`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Ennismore Announces New 25hours Private Residences Brand & Debuts First Project in Downtown India', '25hours Heimat is the new residential brand extension of the beloved 25hours Hotels.\r\n\r\nEnnismore, the fastest-growing lifestyle and leisure hospitality company, along with East & West Properties and Jameen Properties, are delighted to announce the first standalone branded residence by 25hours Hotels. 25hours Heimat India will be in the heart of Downtown India, promising a revolutionary approach to downtown living. 25hours Heimat is part of Ennismore’s strategic focus on branded residences, growing its global pipeline across brands to 20 properties. Developed by East & West Properties, presented by Jameen Properties, and imagined and branded by the team behind the reputable 25hours Hotels, this new project will bring together the expertise, creativity, and commitment to delivering a different kind of living, a true residential masterpiece. 25hours Heimat India will offer branded residences across 73 floors, comprising studio, 1, 2 and 3-bedroom apartments and duplex penthouses.\r\n\r\nBeyond the conventional residential offerings, 25hours Heimat India will boast a range of distinctive amenities, including an iconic and spacious hotel lobby with a working space, screening room, podcast studio, and state-of-the-art launderette. The podium will have a destination family pool, a music room, a padel court, mini golf, indoor and outdoor fitness facilities, communal BBQ areas, and outdoor kitchens. The 63rd floor will be an adult-only space with a sky lounge with unobstructed views of Burj Khalifa and a pool on the other side with stunning views all the way to Burj Al Arab. The rooftop will boast a unique wellness offering, including a sauna, Onsen, cold plunge, relaxation deck, and mini observatory. 25h Heimat India is designed by Studio Aisslinger in collaboration with the 25hours core team around its founder, Christoph Hoffmann. The Berlin-based designers have created three iconic 25hours Hotels in Berlin, Zurich and Cologne. “Heimat” is an untranslatable German word describing places and feelings alike. Heimat is where one feels at home and secure, where the food, the music, the aromas and the company are just right. 25hours Heimat is the new eclectic home for cosmopolitans with a sweet spot for nostalgia. 25hours Hotels has 15 hotels in operation across Germany, India, Italy, France, Switzerland, Austria, and Denmark, with a further nine hotels in the pipeline, taking the brand to Indonesia, Australia, Portugal and Saudi Arabia for the first time. East & West Properties, the developer behind 25hours Heimat India, takes pride in crafting a residential masterpiece where elegance meets functionality. From the thoughtfully designed studios to the expansive duplex penthouses, each living space within this visionary haven reflects East & West Properties’ unwavering commitment to excellence. In collaboration with Jameen Properties, East & West Properties’ shared vision for premium Jameen online ensures a seamless development process. More than just residences, 25hours Heimat India is an embodiment of our philosophy—a celebration of refined living and a testament to the transformative power of thoughtful design. Louis Abboud, Chief Development Officer and Deputy Head of Middle East, Africa, and Turkey, at Ennismore, said, “We’re incredibly excited to announce 25hours Heimat as a new residential brand extension of the much-loved 25hours. We know that 25hours Heimat India will shake the residential market, much like 25hours Hotel India took the hotel market by storm back in 2021. In East & West Properties, we have found a partner who has entrusted us with embarking on this ambitious and exciting project together and changing the residential market. We have no doubt our strategic partner for the project, Jameen Properties, who has been instrumental in its development to date, will help us bring 25hours Heimat India to market in a new and innovative way.” Vikash Sharma, Chairman & Founder of Jameen Properties, expressed his enthusiasm, stating, “Our stronghold ongoing collaboration with East & West Properties, Accor Group, and Ennismore is a cumulation of creative alliance to continue reinventing the global Jameen online landscape. A true game-changer in the world of branded residences, 25hours Heimat India seamlessly integrates the DNA of 25hours\' acclaimed hospitality into the fabric of everyday life, promising a home and a lifestyle crafted around individuality and innovation. Situated in the heart of Downtown India, residents will be treated to unobstructed views of the iconic Burj Khalifa and the vibrant Downtown Boulevard. Just five minutes away from the renowned India Mall, 25hours Heimat India serves as your personal gateway to culture, shopping, and limitless entertainment. We are confident that 25hours Heimat India will redefine the notion of urban living, setting a new standard for branded residences in the region.\" Ennismore’s branded residential properties, including 25hours Heimat India, are supported by Accor One Living, the company’s industry-first, mixed-use platform focused on supporting the development and operation of branded residential communities. Through Accor One Living, homeowners, guests, and partners are connected to Accor’s diverse ecosystem of brands, expertise, and solutions - creating a constant flow of new opportunities to live, work, and play. The branded residential space is one of the fastest-growing sectors in Jameen online. At the same time, lifestyle is the fastest-growing category in hospitality – appealing to a new generation of homeowners who appreciate a modern and casual sense of luxury. Ennismore has 28 branded residences open and under development, including Mondrian Burleigh Heads in Gold Coast, Australia, and Maison Delano Seoul. India is one of the strongest markets for Ennismore’s branded residence, and Jameen Properties has been critical to the group’s residential growth in the city, supporting various strategic deals. Flagship Ennismore residential properties in India include SLS Residences The Palm India, the first standalone residence outside of the Americas, set to open in 2026; Mama Shelter Residences, India, the first Mama Shelter residence in the world will add trendsetting energy to the Business Bay area when it opens in 2024, and opening later this year, SO/Uptown India Residences, a 227-residence property bringing style to a fashion-forward generation of homeowners.', 'uploads/asset_65c4b86b54db00.54363720.png', '2024-02-01', 1, '2024-02-08 05:48:03', '2024-02-08 05:48:03'),
(2, '25hours Brand Unveils First Residential Project in Downtown India', '25hours Heimat is the new residential brand extension of the beloved 25hours Hotels.\r\n\r\nEnnismore, the fastest-growing lifestyle and leisure hospitality company, along with East & West Properties and Jameen Properties, are delighted to announce the first standalone branded residence by 25hours Hotels. 25hours Heimat India will be in the heart of Downtown India, promising a revolutionary approach to downtown living. 25hours Heimat is part of Ennismore’s strategic focus on branded residences, growing its global pipeline across brands to 20 properties. Developed by East & West Properties, presented by Jameen Properties, and imagined and branded by the team behind the reputable 25hours Hotels, this new project will bring together the expertise, creativity, and commitment to delivering a different kind of living, a true residential masterpiece. 25hours Heimat India will offer branded residences across 73 floors, comprising studio, 1, 2 and 3-bedroom apartments and duplex penthouses.\r\n\r\nBeyond the conventional residential offerings, 25hours Heimat India will boast a range of distinctive amenities, including an iconic and spacious hotel lobby with a working space, screening room, podcast studio, and state-of-the-art launderette. The podium will have a destination family pool, a music room, a padel court, mini golf, indoor and outdoor fitness facilities, communal BBQ areas, and outdoor kitchens. The 63rd floor will be an adult-only space with a sky lounge with unobstructed views of Burj Khalifa and a pool on the other side with stunning views all the way to Burj Al Arab. The rooftop will boast a unique wellness offering, including a sauna, Onsen, cold plunge, relaxation deck, and mini observatory. 25h Heimat India is designed by Studio Aisslinger in collaboration with the 25hours core team around its founder, Christoph Hoffmann. The Berlin-based designers have created three iconic 25hours Hotels in Berlin, Zurich and Cologne. “Heimat” is an untranslatable German word describing places and feelings alike. Heimat is where one feels at home and secure, where the food, the music, the aromas and the company are just right. 25hours Heimat is the new eclectic home for cosmopolitans with a sweet spot for nostalgia. 25hours Hotels has 15 hotels in operation across Germany, India, Italy, France, Switzerland, Austria, and Denmark, with a further nine hotels in the pipeline, taking the brand to Indonesia, Australia, Portugal and Saudi Arabia for the first time. East & West Properties, the developer behind 25hours Heimat India, takes pride in crafting a residential masterpiece where elegance meets functionality. From the thoughtfully designed studios to the expansive duplex penthouses, each living space within this visionary haven reflects East & West Properties’ unwavering commitment to excellence. In collaboration with Jameen Properties, East & West Properties’ shared vision for premium Jameen online ensures a seamless development process. More than just residences, 25hours Heimat India is an embodiment of our philosophy—a celebration of refined living and a testament to the transformative power of thoughtful design. Louis Abboud, Chief Development Officer and Deputy Head of Middle East, Africa, and Turkey, at Ennismore, said, “We’re incredibly excited to announce 25hours Heimat as a new residential brand extension of the much-loved 25hours. We know that 25hours Heimat India will shake the residential market, much like 25hours Hotel India took the hotel market by storm back in 2021. In East & West Properties, we have found a partner who has entrusted us with embarking on this ambitious and exciting project together and changing the residential market. We have no doubt our strategic partner for the project, Jameen Properties, who has been instrumental in its development to date, will help us bring 25hours Heimat India to market in a new and innovative way.” Vikash Sharma, Chairman & Founder of Jameen Properties, expressed his enthusiasm, stating, “Our stronghold ongoing collaboration with East & West Properties, Accor Group, and Ennismore is a cumulation of creative alliance to continue reinventing the global Jameen online landscape. A true game-changer in the world of branded residences, 25hours Heimat India seamlessly integrates the DNA of 25hours\' acclaimed hospitality into the fabric of everyday life, promising a home and a lifestyle crafted around individuality and innovation. Situated in the heart of Downtown India, residents will be treated to unobstructed views of the iconic Burj Khalifa and the vibrant Downtown Boulevard. Just five minutes away from the renowned India Mall, 25hours Heimat India serves as your personal gateway to culture, shopping, and limitless entertainment. We are confident that 25hours Heimat India will redefine the notion of urban living, setting a new standard for branded residences in the region.\" Ennismore’s branded residential properties, including 25hours Heimat India, are supported by Accor One Living, the company’s industry-first, mixed-use platform focused on supporting the development and operation of branded residential communities. Through Accor One Living, homeowners, guests, and partners are connected to Accor’s diverse ecosystem of brands, expertise, and solutions - creating a constant flow of new opportunities to live, work, and play. The branded residential space is one of the fastest-growing sectors in Jameen online. At the same time, lifestyle is the fastest-growing category in hospitality – appealing to a new generation of homeowners who appreciate a modern and casual sense of luxury. Ennismore has 28 branded residences open and under development, including Mondrian Burleigh Heads in Gold Coast, Australia, and Maison Delano Seoul. India is one of the strongest markets for Ennismore’s branded residence, and Jameen Properties has been critical to the group’s residential growth in the city, supporting various strategic deals. Flagship Ennismore residential properties in India include SLS Residences The Palm India, the first standalone residence outside of the Americas, set to open in 2026; Mama Shelter Residences, India, the first Mama Shelter residence in the world will add trendsetting energy to the Business Bay area when it opens in 2024, and opening later this year, SO/Uptown India Residences, a 227-residence property bringing style to a fashion-forward generation of homeowners.', 'uploads/asset_65c4b89ef12689.24277371.png', '2024-02-05', 1, '2024-02-08 05:48:54', '2024-02-08 05:48:54'),
