INSERT INTO `services` (`id`, `title`, `description`, `image`, `category`, `status`, `created_at`, `updated_at`) VALUES
(2, 'Increased Privacy & Control', 'Unlike a hotel or resort shared by many tourists, you will have more privacy and control of your surroundings at a holiday home.', 'uploads/asset_65a12cce83b757.73606084.png', 7, 1, '2024-01-12 06:43:02', '2024-01-12 06:43:02'),
(3, 'Regular Maintenance', 'It is of utmost importance that every property is handed to vacationers in pristine and ornate conditions.', 'uploads/asset_65a12ced4b02f6.59683384.png', 7, 1, '2024-01-12 06:43:33', '2024-01-12 06:43:33'),
(4, 'Advance Price Action Guidance', 'A holiday home is ideal for larger families as they have enough rooms to house everyone comfortably', 'uploads/asset_65a12d0146eab7.20334571.png', 7, 1, '2024-01-12 06:43:53', '2024-01-12 06:43:53'),
(5, 'Luxury Concierge Service', 'A vacation is as good as the smooth sailing experiences one has. From airport pick-up & delivery, to plane bookings and fine dining reservations', 'uploads/asset_65a12d11b2be41.91254433.png', 7, 1, '2024-01-12 06:44:09', '2024-01-12 06:44:09'),
(6, 'Safety & Security', 'All of our premises are located in family-friendly communities in the heart of Dubai, which is known as one of the safest cities in the world.', 'uploads/asset_65a12d2648c2f4.58626906.png', 7, 1, '2024-01-12 06:44:30', '2024-01-12 06:44:30'),
(7, 'Best for Large Families', 'A holiday home is ideal for larger families as they have enough rooms to house everyone comfortably', 'uploads/asset_65a12d33d9be87.01861308.png', 7, 0, '2024-01-12 06:44:43', '2024-01-12 06:57:55'),
(10, 'Venture Into the World of Investments', 'D&B Investments & Advisory is an integrated division under D&B Properties and Bayari Investments, offering investors and high-net-worth individuals (HNWI’s) in Dubai opportunities to enter new markets with confidence and connecting them with the most lucrative investment funds and business stake. Using cutting-edge research and data analysis, investors are advised by RERA-licensed professionals every step of the way in making informed decisions based on current trends in real estate performance.\r\nBacked by a multitude of senior-level industry experts along with a commitment to excellence, D&B Investments & Advisory is the premier choice for real estate and business investments in Dubai. We provide our clients with access to exclusive real estate and business projects, priceless knowledge of the market, and a commitment to maximizing financial profitability on all investments.', 'uploads/asset_65b78ab17a9911.06925062.png', 4, 1, '2024-01-29 05:53:29', '2024-01-29 05:53:29'),
(11, 'Booming Sectors & Projects for Investment', '1.Residential & Commercial Bulk Units\n2.Industries & Factories\n3.Businesses & Equities For Sale\n4.Joint Ventures\n5.Hospitality & Healthcare\n6.Education', 'uploads/asset_65b78af5ac4163.25510363.png', 4, 1, '2024-01-29 05:54:37', '2024-01-29 05:54:37'),
(13, 'Documentation', 'We keep all the important files in one place and we make sure that it\'s secured and available for you anytime.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b7908f8e0f15.94749567.png', 5, 1, '2024-01-29 06:18:31', '2024-01-29 06:18:31'),
(14, 'Document Processing', 'Our team will identify and execute the perfect approach to speed up the process, eliminating any unnecessary delays.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b791a7322234.94863336.png', 5, 1, '2024-01-29 06:23:11', '2024-01-29 22:56:41'),
(15, 'Mortgage Assistance', 'One of the first steps to getting back on track is understanding the range of options available.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b792dc27f403.15810784.png', 5, 1, '2024-01-29 06:28:20', '2024-01-29 06:28:20'),
(16, 'Legal Assistance', 'We can represent both parties with power of attorneys, property-related legal services, property dispute, and resolution\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b79314b072d8.69130634.png', 5, 1, '2024-01-29 06:29:16', '2024-01-29 06:29:16'),
(17, 'Understanding the purpose and function of the valuation', 'We provide you with a comprehensive understanding of the market value of your property as well as aiding with price negotiations if you are looking to sell your property\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b79475491a90.36714690.png', 6, 1, '2024-01-29 06:35:09', '2024-01-29 06:35:09'),
(18, 'Verifying relevant property documents', 'All relevant documents of the property, including the building plans and survey maps, or any other important documents that you may have, should be verified by professional valuators before starting the valuation process of your property.Our work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REA', 'uploads/asset_65b7948a624720.97427798.png', 6, 1, '2024-01-29 06:35:30', '2024-01-29 06:35:30'),
(19, 'Inspecting the property by professional valuators', 'Professional appraisers will conduct an on-site inspection of the property to be evaluated. There could be multiple visits to the property, with the appraisers looking at different factors. The findings will be documented to prepare a detailed report. Our work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b7949b312676.36649011.png', 6, 1, '2024-01-29 06:35:47', '2024-01-29 06:35:47'),
(20, 'Analysing the data collected from the property', 'The expert appraiser collects as much data as possible by inspecting the property and communicating to the owner or contact person. After careful analyses and computation, the professionals calculate the value of the property transparently. Our work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b794ae5c8321.54258650.png', 6, 1, '2024-01-29 06:36:06', '2024-01-29 06:36:06'),
(21, 'Property Management', 'REAL is an integrated company under D&B Properties and Bayari Holding, focusing on managing assets and portfolios within the UAE, GCC, Middle East and Africa region.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b796100dac71.29744679.png', 1, 1, '2024-01-29 06:42:00', '2024-01-29 06:42:00'),
(22, 'Financial Management', 'Upon acquiring a client’s property requirements, our team ensures high quality services throughout the issued contract as per Royal Institution of Chartered Surveyors (RICS) standards and in line with Dubai Real Estate Regulatory Agency (RERA) guidelines.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REA', 'uploads/asset_65b796292e8ab9.68008816.png', 1, 1, '2024-01-29 06:42:25', '2024-01-29 06:42:25'),
(23, 'Facility Management', 'REAL is an integrated company under D&B Properties and Bayari Holding, focusing on managing assets and portfolios within the UAE, GCC, Middle East and Africa region.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b7963b9f0ba6.49401765.png', 1, 1, '2024-01-29 06:42:43', '2024-01-29 06:42:43'),
(24, 'Not Bound by Annual Contracts', 'You can reclaim your property at any time as it is not bound by yearly tenancy contracts.', 'uploads/asset_65b797afcb08e6.24080482.png', 2, 1, '2024-01-29 06:48:55', '2024-01-29 06:48:55'),
(25, 'Chance to Earn More Rental Income', 'You could earn up to 20% higher rental income by listing your property for short-term rental.', 'uploads/asset_65b797c8d05320.32197295.png', 2, 1, '2024-01-29 06:49:20', '2024-01-29 06:49:20'),
