(27, 'Regular Maintenance and Management', 'We maintain your holiday home in pristine condition between each check-in and check-out.', 'uploads/asset_65b797f7636871.08327841.png', 2, 1, '2024-01-29 06:50:07', '2024-01-29 06:50:07'),
(28, 'We advise clients', 'REAL is an integrated company under D&B Properties and Bayari Holding, focusing on managing assets and portfolios within the UAE, GCC, Middle East and Africa region.\r\nWhether handling the portfolio of a five-star luxury hotel, or overseeing the development and supervision of a residential or commercial tower in a growing community, the REAL team spearheads the project with efficacy and efficiency. We intend to conduct all our communications with our clients in a straightforward manner that leaves all parties informed on decisions.\r\nOur work is centered around a professional level of service delivered through our trained and qualified team, and via specialist sub-contracted suppliers if required. From a systematic upkeep of your property to maximizing on revenue, the specialist REAL', 'uploads/asset_65b798c3a2b9d8.81145946.png', 3, 1, '2024-01-29 06:53:31', '2024-01-29 06:53:31'),
